    $('.translation').on( "mouseenter blur", function(){
	    key = $(this).attr('id');
	    translation = $(this).html();

	    $.ajaxSetup({
	      headers: {
	        'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
	      }
	    });

	    $.post("{{route('update')}}", {'key':key, 'translation':translation}, function (data) {
	        if(data == ''){
	            $.toast({type: 'info', text: "Saved"});
	        }else{
	            $.toast({type: 'warning', text: "Something went wrong"});
	        }
	    });
	});

	$('.btn-show-keys').on('click', function(){
		$('.btn-show-keys').addClass('hidden');
		$('.btn-hide-keys').removeClass('hidden');
		$('.toggle').removeClass('hidden');
	});

	$('.btn-hide-keys').on('click', function(){
		$('.btn-show-keys').removeClass('hidden');
		$('.btn-hide-keys').addClass('hidden');
		$('.toggle').addClass('hidden');
	});
</script>